import './App.css';
import { BrowserRouter , Route, Routes, Link } from 'react-router-dom';
import Login from './components/Login'; // Ensure this path is correct

function App() {
  return (
    <BrowserRouter>
      <div className='main'>
        <div className='main-content'></div>
        <div className='message'>
          <h1>Better grades</h1>
          <h1>at no cost</h1>
          <h1>literally!</h1>
        </div>
        <img src="/students.jpg" alt="Logo" />
        <div className="buttons">
          <Link to="/signup">
            <div className='button-1'>Sign up</div>
          </Link>
          <Link to="/login">
            <div className='button-2'>Log in</div>
          </Link>
        </div>

        {/* Define your routes here, outside of the buttons */}
        <Routes>
          <Route path="/login" element={<Login />} />
          {/* You can add more routes for other components */}
        </Routes>
      </div>
      </BrowserRouter>
  );
}

export default App;
